import React, { useState, useEffect } from "react";

const Enquiries = () => {
  const [enquiries, setEnquiries] = useState([]);

  useEffect(() => {
    const fetchEnquiries = async () => {
      try {
        const response = await fetch("/api/v1/holidaze/bookings");
        if (!response.ok) {
          throw new Error("Failed to fetch enquiries");
        }
        const data = await response.json();
        setEnquiries(data);
      } catch (error) {
        console.error("Error fetching enquiries:", error.message);
      }
    };

    fetchEnquiries();
  }, []);

  return (
    <div>
      <h2>Enquiries</h2>
      <ul>
        {enquiries.map((enquiry) => (
          <li key={enquiry.id}>
            <strong>Name:</strong> {enquiry.name}, <strong>Email:</strong>{" "}
            {enquiry.email}, <strong>Message:</strong> {enquiry.message}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Enquiries;
